import React, { useEffect, useState } from 'react';
import { Link, useLocation, useNavigate } from 'react-router-dom';

const Header = ({}) => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const location = useLocation();
  const navigate = useNavigate();
  const [dropdownOpen, setDropdownOpen] = useState(false);
  console.log(isLoggedIn)

  const handleLogout = () => {
    // Perform logout actions like removing auth token
    localStorage.removeItem('authToken');
    // Redirect to login page
    navigate('/login');
  };

  const toggleDropdown = () => {
    setDropdownOpen(!dropdownOpen);
  };

  useEffect(() => {
    // Check if the token exists in local storage
    const token = localStorage.getItem('authToken');
    if (token) {
      setIsLoggedIn(true);
    } else {
      setIsLoggedIn(false);
    }
  }, []);

  return (
    <div>
      <h1>User Profile</h1>
      <div className="flex">
        {/* "profile svg" */}
        <button
          onClick={toggleDropdown}
          type="button"
          className="flex items-center justify-center bg-transparent rounded-full focus:ring-4 focus:ring-gray-300 dark:focus:ring-gray-600"
          id="user-menu-button"
          aria-expanded={dropdownOpen}
          aria-haspopup="true"
        >
          <span className="sr-only">Open user menu</span>
          <img className="w-8 h-8 rounded-full" src="https://www.svgrepo.com/show/512690/profile-1335.svg" alt="user photo" />
        </button>

        {/* Second image */}
        <img className="w-8 h-8 rounded-full ml-4" src="second-image-url" alt="second user photo" />
      </div>
    </div>
  );
};

export default Header;
